import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import { createTheme, ThemeProvider, styled } from "@mui/material/styles";
import { green } from "@mui/material/colors";

export default function AddMenuComponent() {

    const theme = createTheme({
        palette: {
          primary: {
            main: green[200],
          },
          secondary: {
            main: green[500],
          },
        },

        components: {
          MuiCard: {
            styleOverrides: {
              root: { margin: 8, maxWidth: 345}
            },
          },
        },
      });

    return(
    <>
        <ButtonAppBar></ButtonAppBar>

        <Grid container spacing={2}>
            <Grid item xs={8}>
                <CategoryListComposition></CategoryListComposition>
            </Grid>
            <Grid item xs={8}>
                <TextField id="outlined-basic" label="Name" variant="outlined" />
            </Grid>
            <Grid item xs={8}>
                <TextField id="outlined-basic" label="Options" variant="outlined" />
            </Grid>
            <Grid item xs={8}>
                <TextField id="outlined-basic" label="Price" variant="outlined" />
            </Grid>
            <Grid item xs={8}>
                <TextField id="outlined-basic" label="Cost" variant="outlined" />
            </Grid>
            <Grid item xs={8}>
                <TextField id="outlined-basic" label="Amount" variant="outlined" />
            </Grid>
            <Grid item xs={8}>
                <Button variant="contained">Add</Button>
            </Grid>
        </Grid>
    </>
    );
}
